import React from "react";
import styled from "styled-components";

const Education = () => {
  return (
    <Container>
      <h1>Education</h1>
      <ul>
        <li>
          <h2>2014-2017</h2>
          <p>
            <span>TÜRKİYE DIYANET VAKFI BAKI TÜRK LİSEYİ</span>
            Before here, I was study in number of 86 and "HFTML" schools. In
            2014, I was accepted to this school with a exam. During the my study
            years , I won various certificates and appreciation. And I finished
            secondary school with the good results I collected thanks to my
            school.
          </p>
        </li>
        <li></li>
        <li></li>
      </ul>
    </Container>
  );
};

export default Education;
const Container = styled.div`
display: flex;
flex-direction: column;
align-items: center;
padding: 20px;
color: #182153;
h1{
    font-weight: 500;
    font-size: 25px;
}
  ul{
      width: 45%;
      list-style: none;
  }
  ul>li{
      display: flex;
align-items: center;
justify-content: space-between;
      text-align: left;
      font-size: 14px;
      line-height: 2;
      opacity: 0.8;
      span{
          font-weight: 500;
          display: block;
          padding: 10px 0;
      }
  }
`;
